import React from "react";
import "./app.css";

function App() {
  const name = "lucy"; 

  return(
    <React.Fragment>
  <h1>Hello</h1>
  {name && <h1>Welcome! {name}</h1>}
  </React.Fragment>
  );
}

export default App;
